import React from 'react';
import { Routes, Route, Link, useLocation } from 'react-router-dom';
import MesRendezVous from './patient/MesRendezVous';
import MonDossier from './patient/MonDossier';
import MesConsultations from './pages/patient/MesConsultations';

const PatientDashboard = () => {
  const location = useLocation();

  const navItems = [
    { name: 'Accueil', path: '/patient', icon: 'üè†' },
    { name: 'Rendez-vous', path: '/patient/rendez-vous', icon: 'üìÖ' },
    { name: 'Dossier', path: '/patient/dossier', icon: 'üìÅ' },
    { name: 'Consultations', path: '/patient/consultations', icon: 'ü©∫' }
  ];

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Sidebar */}
      <div className="fixed h-full w-64 bg-white shadow-lg lg:block hidden">
        <div className="p-6 border-b">
          <h1 className="text-2xl font-bold text-gray-900">Patient</h1>
        </div>
        <nav className="p-4 space-y-2">
          {navItems.map(item => (
            <Link
              key={item.path}
              to={item.path}
              className={`flex items-center p-3 rounded-lg w-full ${
                location.pathname === item.path
                  ? 'bg-blue-100 text-blue-800 border-r-4 border-blue-500'
                  : 'text-gray-700 hover:bg-gray-100'
              }`}
            >
              <span className="mr-3 text-lg">{item.icon}</span>
              {item.name}
            </Link>
          ))}
        </nav>
      </div>

      {/* Content */}
      <div className="lg:ml-64 p-6">
        <Routes>
          <Route path="/" element={<div className="p-8 bg-white rounded-xl shadow-sm">
            <h1 className="text-3xl font-bold mb-4">Bienvenue dans votre espace patient</h1>
            <p className="text-gray-600">S√©lectionnez une section dans le menu</p>
          </div>} />
          <Route path="/rendez-vous" element={<MesRendezVous />} />
          <Route path="/dossier" element={<MonDossier />} />
          <Route path="/consultations" element={<MesConsultations />} />
        </Routes>
      </div>
    </div>
  );
};

// ‚úÖ EXPORTS POUR COMPATIBILIT√â App.js
export const PatientLayoutWrapper = ({ children }) => <>{children}</>;
export const DashboardHome = () => (
  <div className="p-8">
    <h1>Accueil Patient</h1>
  </div>
);

export default PatientDashboard;
